import React from 'react';
import Header from './Header';

// JSX (Javascript XML)


function App() {

  let counter = 0;

  let increment = () => {
    counter++;
    console.log(counter);
  }

  return (
    <div>
    <Header >
      Contador: {counter}
    </Header>
    <button onClick={increment}>Incrementar</button>
    </div>
  );
}

export default App;
